script: |
  super -f text -I q12803.spq | sort > q12803.out

inputs:
  - name: q12803.spq
    data: |
      SELECT ALL - 86 + col0 * + col2 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT + 67 NOT BETWEEN NULL AND - ( col1 ) / - + col2 + - col2 + + 48 - col0;
  - name: tab0

outputs:
  - name: q12803.out
    data: |
